import React, { useState, useEffect } from "react";

import ItemForm from "../item/ItemForm";

const Board = ({ oneBoard }) => {
  return (
    <div>
      <h3>{oneBoard.title}</h3>
      {oneBoard.items.map((item) => {
        return <p>{item}</p>;
      })}
      <ItemForm />
    </div>
  );
};

export default Board;
